import React from 'react'
import styles from '../styles/AddForm.module.css'

function AddForm() {

  const submitHandler = e => {
    e.preventDefault()

  }
  return (
      <form onSubmit={submitHandler}>
        <label>Team's Name:<input type="text"/></label>

        <label>Team's City:<input type="text"/></label>

        <label>Team's State:<input type="text"/></label>

        <label>Team's Stadium:<input type="text"/></label>

        <label>Team's Picture:<input type="text"/></label>

        <button>Submit</button>
      </form>
  )
}

export default AddForm
